import "./MuseumCard.css";

export default function MuseumCardImage() {
  return (
    <>
      <img
        src="https://media.timeout.com/images/101805235/1920/1080/image.jpg"
        alt="National Museum of Singapore"
        className="museumCardImage"
      />
    </>
  );
}
